import React from "react";
import Product from "./Product";
import productsData from "./vschoolProducts"


function App(){
    const productComponents = productsData.map(item => <Product product={item}/>)

    return (
        <div>
            <h1></h1>
            {productComponents}
        </div>
    )
}
export default App
